import React from 'react';
import Header from './Navbar';

function Dashboard() {
  return (
    <div>
      <Header adminName="Jane Doe" />
      <div className="p-4">
        <h2 className="text-xl font-semibold">Welcome, Jane Doe!</h2>
      </div>
    </div>
  );
}

export default Dashboard;
